public class Car {    private String rangi;    private String modeli;    private int narxi;    private Boolean Avtomat;    public Car(String modeli, String rangi, int narxi, Boolean Avtomat) {        this.rangi = rangi;        this.modeli = modeli;        this.narxi = narxi;        this.Avtomat = Avtomat;    }    public Car(){}        public String getRangi() {        return rangi;    }    public void setRangi(String rangi) {        this.rangi = rangi;    }    public String getModeli() {        return modeli;    }    public void setModeli(String modeli) {        this.modeli = modeli;    }    public int getNarxi() {        return narxi;    }    public void setNarxi(int narxi) {        this.narxi = narxi;    }    public Boolean getAvtomat() {        return Avtomat;    }    public void setAvtomat(Boolean avtomat) {        Avtomat = avtomat;    }}